    <script src=""https://unpkg.com/aos@2.3.1/dist/aos.js""></script>

    <script>
        AOS.init({ once: true });

        $('#formLogin').on('submit', function (e) {
            e.preventDefault();

            if (!$("".form-control"").isValid) {
                var formData = $('#formLogin').serialize();

                $.ajax({
