                    type: ""POST"",
                    data: formData,
                    dataType: ""json"",
                    success: function (result) {
                        if (!result.status) {
                            Swal.fire({
                                icon: 'error',
                                title: 'Login Gagal!',
                                text: result.pesan,
                                confirmButtonColor: '#f2aa4c',
                                confirmButtonText: 'Close'
                            })
                        }
